// 日本語。
using WWMath;

namespace WWKeyClassifier2 {
    public class KeyClassifierCore {
        public KeyClassifierCore() {
            // 分類器を準備。
            mClassifier = new MulticlassLinearSVMClassifier(mInputPredictorNames.Length, mOutputLabelNames.Length);
            mClassifier.SetOutputClassLabels(mOutputLabelNames);
            for (int i = 0; i < mBinaryLinearSVMParamAry.Length; ++i) {
                var p = mBinaryLinearSVMParamAry[i];
                mClassifier.AddBinaryClassifier(new BinaryLinearSVMClassifier(p.beta, p.scale, p.bias));
            }
        }

        public int Classify(float[] inputX) {
            int yPred = mClassifier.Classify(inputX);
            return yPred;
        }
        
        /// <summary>
        /// 観測値ベクトルを入力して分類を実行。
        /// </summary>
        public string ClassifyS(float[] inputX) {
            int y = mClassifier.Classify(inputX);
            string s = mClassifier.ClassifyResultToStr(y);
            return s;
        }

        /// <summary>
        /// Classifyの戻り値のkey番号を調の文字列表現に変換。
